import React, { useEffect } from 'react'
import { useState } from 'react'
import axios from 'axios'
var count = 1
const Views = () => {
    const [integers, setIntegers] = useState([])
    async function fetchAllInts(){
        try {
            let response = await axios.get("http://localhost:8800/data/1");
            console.log(response[0]);
            setIntegers(response.data);
            if (count == 50){
                count = 1;
            } else {
                count++;
            }
        } catch(err){
            console.log(err)
        }
    }

    useEffect(() => {   
        fetchAllInts()
    }, [])


    return (
        <div>
            <h1>Test Data</h1>
            <div className="datas">
                {integers.map(integer=>(
                    <div className="data">
                        <p></p>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Views;
